import https from "./httpService";
import { apiUrl } from "../config.json";
import { openNotification } from "../components/common/notification";
export function login(values, history) {
  https
    .post(apiUrl + "user/login", {
      email: values.email,
      password: values.password
    })
    .then(res => {
      if (res.data.status === 200) {
        history.replace(`/admin/${res.data.data}`);
      } else if (res.data.status === 302)
        history.replace(`/user/${res.data.data}`);
      if (res.data.status === 401)
        return openNotification(
          "error",
          "Email or Password is not valid",
          "Please retype Email or Password"
        );
    });
}
